INSERT INTO `qqbtc_config` VALUES (1,'5a75b11fafb35.png','1','c','','','1000','1','','您好，欢迎来到玩客币(链克)交易网','BPc全球数字资产交易平台','BPc全球数字资产交易平台 - 国际化的数字交易平台','5ac883f559e79.jpg','5add72dbe884b.png','链克交易|玩客币交易|链克交易网|链克交易平台|玩客币|玩客云玩客币|迅雷数字货币|玩客币数字资产交易平台','玩客币(链克)交易网 - 专业专注的玩客币(链克)交易平台','1','感谢您对bpc的关注,我们服务器正在升级中,即将回来...请稍后访问！','粤ICP备111110000号-1','','100','bpc 与用户共同确认：<br />\r\n<br />\r\n1 用户点击 bpc 注册页面的[同意注册]按钮并完成注册程序，获得 bpc 账号和密码时，视为用户与 bpc 已达成《用户协议》(下称“本协议”)，就用户进入 bpc 使用 bpc 相应的交易服务达成本协议的全部约定<br />\r\n<br />\r\n。<br />\r\n<br />\r\n2 bpc 及用户均已认真阅读《用户协议》中全部条款及 bpc 发布的法律声明和操作规则的内容，对本协议及前述服务条款、法律声明和操作规则均已知晓、理解并接受，同意将其作为确定双方权利义务的依据。 bpc 《法律声明》为本<br />\r\n<br />\r\n协议的必要组成部分，用户接受本协议的同时即视为接受 bpc 《法律声明》的全部内容。本协议内容包括本协议正文以及 bpc 已经发布的或将来可能发布的各类规则、声明、说明。 所有规则、声明、说明为协议不可分割的一部分，与协议正文具<br />\r\n<br />\r\n有同等法律效力。<br />\r\n<br />\r\n3 本协议不涉及 bpc 用户与其他用户之间因数字货币交易而产生的法律关系及法律纠纷。<br />\r\n<br />\r\n一、定义条款<br />\r\n<br />\r\n1.1 “玩客币”：基于“玩客云”智能硬件，依托共享经济云计算和区块链技术的数字资产。（玩客币，简称OTC）。<br />\r\n<br />\r\n1.2 “ bpc ”：域名为www.bpc，该网络交易平台为数字货币玩家提供进行数字货币投资理财服务。本协议下文中，“ bpc ”指综合性数字货币投资理财平台（www.bpc）。<br />\r\n<br />\r\n1.3 “用户”：接受并同意本协议全部条款及 bpc 不时发布或更新的法律条款及操作规则、通过 bpc 进行数字货币投资理财的 bpc 注册会员。<br />\r\n<br />\r\n1.4 “用户注册”：用户注册是指用户登录 bpc 并按要求填写相关信息并确认，同意履行相关用户协议的过程。<br />\r\n<br />\r\n1.5 “数字货币投资”：用户通过 bpc 进行的玩客币等数字货币投资活动。<br />\r\n<br />\r\n1.6 “充值款”：用户为购买数字货币/出售数字货币而向 bpc 平台预充入的法币/数字货币的款项。<br />\r\n<br />\r\n1.7 “手续费”：用户在 bpc 达成数字货币投资而向 bpc 支付的各项服务费用。<br />\r\n<br />\r\n二、用户注册<br />\r\n<br />\r\n2.1 注册资格<br />\r\n<br />\r\n用户承诺：用户具有完全民事权利能力和行为能力，或虽不具有完全民事权利能力和行为能力,但点击同意注册按钮， 本网即视为经其法定代理人同意并由其法定代理人代理注册及应用 bpc 服务。<br />\r\n<br />\r\n2.2 注册目的<br />\r\n<br />\r\n用户承诺：用户进行用户注册并非出于违反法律法规或破坏 bpc 数字货币投资秩序的目的。<br />\r\n<br />\r\n2.3 注册流程<br />\r\n<br />\r\n2.3.1 用户同意根据 bpc 用户注册页面的要求提供有效电子邮箱等信息，设置 bpc 账号及密码，用户应确保所提供全部信息的真实性、完整性和准确性。<br />\r\n<br />\r\n2.3.2 用户合法、完整并有效提供注册所需信息的，有权获得 bpc 账号和密码， bpc 账号和密码用于用户在 bpc 进行会员登录。<br />\r\n<br />\r\n2.3.3 用户获得 bpc 账号及密码时视为用户注册成功，用户同意接收 bpc 发送的与 bpc 网站管理、运营相关的电子邮件、短消息。<br />\r\n<br />\r\n2.3.4 用户注册成功后进行数字货币交易及投资。<br />\r\n<br />\r\n三、用户服务<br />\r\n<br />\r\nbpc 为用户通过 bpc 进行数字货币投资活动提供网络交易平台服务。 bpc 不作为买家或是卖家参与买卖数字货币交易。<br />\r\n<br />\r\n3.1 服务内容<br />\r\n<br />\r\n3.1.1 用户有权在 bpc 浏览数字货币实时行情及交易信息、有权通过 bpc 提交数字货币交易指令并完成数字货币交易。<br />\r\n<br />\r\n3.1.2 用户有权在 bpc 查看其 bpc 会员账号下的信息，有权应用 bpc 提供的功能进行操作。<br />\r\n<br />\r\n3.1.3 用户有权按照 bpc 发布的活动规则参与 bpc 组织的网站活动。<br />\r\n<br />\r\n3.1.4 bpc 承诺为用户提供的其他服务。<br />\r\n<br />\r\n3.2 服务规则<br />\r\n<br />\r\n用户承诺遵守下列 bpc 服务规则：<br />\r\n<br />\r\n3.2.1 用户应当遵守法律法规、规章、规范性文件及政策要求的规定，保证账户中所有资金和数字货币来源的合法性，不得在 bpc 或利用 bpc 服务从事非法或其他损害 bpc 或第三方权益的活动，如发送任何违法、违规、违反公序良俗<br />\r\n<br />\r\n、侵犯他人权益的信息，发送传销材料或存在其他危害的信息或言论，未经 bpc 授权使用或伪造 bpc 电子邮件题头信息等。<br />\r\n<br />\r\n3.2.2 用户应当遵守法律法规应当妥善使用和保管其 bpc 账号及密码、资金密码、和其注册时绑定的手机号码、以及手机接收的手机验证码的安全。用户对使用其 bpc 账号和密码、资金密码、手机验证码进行的任何操作和后果承担全部责任。当<br />\r\n<br />\r\n用户发现 bpc 账号、密码、或资金密码、验证码被未经其授权的第三方使用，或存在其他账号安全问题时，应立即有效通知 bpc ，要求 bpc 暂停该 bpc 账号的服务。 bpc 有权在合理时间内对用户的紧急请求采<br />\r\n<br />\r\n取行动，但对于 bpc 采取行动前用户已经遭受的损失不承担任何责任。用户在未经 bpc 同意的情况下不得将 bpc 账号以赠与、借用、租用、转让或其他方式处分给他人。<br />\r\n<br />\r\n3.2.3 用户应当遵守 bpc 不时发布和更新的用户协议以及其他服务条款和操作规则。<br />\r\n<br />\r\n四、数字货币交易规则<br />\r\n<br />\r\n用户承诺在其进入 bpc 交易，通过 bpc 与其他用户进行数字货币交易的过程中遵守如下 bpc 数字货币交易规则。<br />\r\n<br />\r\n4.1 浏览交易信息<br />\r\n<br />\r\n用户在 bpc 浏览数字货币交易信息时，应当仔细阅读交易信息中包含的全部内容，不限于数字货币价格、委托量、手续费、买入或卖出方向，用户完全接受交易信息中包含的全部内容后方可点击按钮进行交易。<br />\r\n<br />\r\n4.2 提交委托<br />\r\n<br />\r\n在浏览完交易信息确认无误之后用户可以提交交易委托。用户提交交易委托后，即用户授权 bpc 代理用户进行相应的交易撮合， bpc 在有满足用户委托价的交易时将会自动完成撮合交易而无需提前通知用户。<br />\r\n<br />\r\n4.3 查看交易明细<br />\r\n<br />\r\n用户可以通过管理中心的交易明细中查看相应的成交记录，确认自己的详情交易记录。<br />\r\n<br />\r\n4.4 撤销/修改委托<br />\r\n<br />\r\n在委托未达成交易之前，用户有权随时撤销或修改委托。<br />\r\n<br />\r\n五、用户的权利和义务<br />\r\n<br />\r\n5.1 用户有权按照本协议约定，接受 bpc 提供的数字货币交易平台服务。<br />\r\n<br />\r\n5.2 用户有权随时终止使用 bpc 服务。<br />\r\n<br />\r\n5.3 用户有权随时提取在 bpc 的资金余额，包括人民币以及数字货币，但需向 bpc 支付相应的提现手续费用。<br />\r\n<br />\r\n5.4 用户对注册时提供的个人资料的真实性、有效性及安全性负责。<br />\r\n<br />\r\n5.5 用户在 bpc 进行数字货币交易时不得恶意干扰数字货币交易的正常进行、破坏交易秩序。<br />\r\n<br />\r\n5.6 用户不得以任何技术手段或其他方式干扰 bpc 的正常运行或干扰其他用户对 bpc 服务的使用。<br />\r\n<br />\r\n5.7 如用户因网上交易与其他用户产生诉讼的，不得通过司法或行政以外的途径要求 bpc 提供相关资料。<br />\r\n<br />\r\n5.8 用户不得以虚构事实等方式恶意诋毁 bpc 的商誉。<br />\r\n<br />\r\n六、 bpc 的权利和义务<br />\r\n<br />\r\n6.1 如用户不具备本协议约定的注册资格，则 bpc 有权拒绝用户进行注册，对已经注册的用户有权注销其 bpc 会员账号， bpc 因此而遭受损失的有权向前述用户或其法定代理人主张赔偿。同时， bpc 保留其他任何情况下<br />\r\n<br />\r\n决定是否接受用户注册的权利。<br />\r\n<br />\r\n6.2 bpc 发现账户使用者并非账户初始注册人时，有权中止该账户的使用。<br />\r\n<br />\r\n6.3 bpc 通过技术检测、人工抽检等检测方式确认用户提供的信息错误、不实、失效或不完整时，有权通知用户更正、更新信息或中止、终止为其提供 bpc 服务。<br />\r\n<br />\r\n6.4 bpc 有权在发现 bpc 上显示的任何信息存在明显错误时，对信息予以更正。<br />\r\n<br />\r\n6.5 bpc 保留随时修改、中止或终止 bpc 服务的权利， bpc 行使修改或中止服务的权利不需事先告知用户， bpc 终止 bpc 一项或多项服务的，终止自 bpc 在网站上发布终止公告之日生效。<br />\r\n<br />\r\n6.6 bpc 应当采取必要的技术手段和管理措施保障 bpc 的正常运行，并提供必要、可靠的交易环境和交易服务，维护数字货币交易秩序。<br />\r\n<br />\r\n6.7 如用户连续一年未使用 bpc 会员账号和密码登录 bpc ，则 bpc 有权注销用户的 bpc 账号。账号注销后， bpc 有权将相应的会员名开放给其他用户注册使用。<br />\r\n<br />\r\n6.8 bpc 通过加强技术投入、提升安全防范等措施保障用户的人民币资金及数字货币托管安全，有义务在用户资金出现可以预见的安全风险时提前通知用户。<br />\r\n<br />\r\n6.9 bpc 有权在本协议履行期间及本协议终止后保留用户的注册信息及用户应用 bpc 服务期间的全部交易信息，但不得非法使用该等信息。<br />\r\n<br />\r\n6.10 bpc 有权随时删除 bpc 网站内各类不符合国家法律法规、规范性文件或 bpc 网站规定的用户评价等内容信息， bpc 行使该等权利不需提前通知用户。<br />\r\n<br />\r\n七、特别声明<br />\r\n<br />\r\n7.1 在法律允许的范围内，不论在何种情况下， bpc 对由于信息网络设备维护、信息网络连接故障、电脑、通讯或其他系统的故障、电力故障、罢工、劳动争议、暴乱、起义、骚乱、生产力或生产资料不足、火灾、洪水、风暴、爆炸、战争、政府行为、司法<br />\r\n<br />\r\n行政机关的命令、其他不可抗力或第三方的不作为而造成的不能服务或延迟服务，以及用户因此而遭受的损失不承担责任。<br />\r\n<br />\r\n八、知识产权<br />\r\n<br />\r\n8.1 bpc 所包含的全部智力成果包括但不限于网站标志、数据库、网站设计、文字和图表、软件、照片、录像、音乐、声音及其前述组合， 软件编译、相关源代码和软件 (包括小应用程序和脚本)的知识产权权利均归 bpc 所有。用户不得为商业目<br />\r\n<br />\r\n的复制、更改、拷贝、发送或使用前述任何材料或内容。<br />\r\n<br />\r\n8.2 bpc 名称中包含的所有权利 (包括但不限于商誉和商标、标志) 均归北京币云技术有限公司所有。<br />\r\n<br />\r\n8.3 用户接受本协议即视为用户主动将其在 bpc 发表的任何形式的信息的著作权，包括但不限于：复制权、发行权、出租权、展览权、表演权、放映权、广播权、信息网络传播权、摄制权、改编权、翻译权、汇编权以及应当由著作权人享有的其他可转让权利<br />\r\n<br />\r\n无偿独家转让给 bpc 所有， bpc 有权利就任何主体侵权单独提起诉讼并获得全部赔偿。本协议属于《中华人民共和国著作权法》第二十五条规定的书面协议，其效力及于用户在 bpc 发布的任何受著作权法保护的作品内容， 无论该内<br />\r\n<br />\r\n容形成于本协议签订前还是本协议签订后。<br />\r\n<br />\r\n8.4 用户在使用 bpc 服务过程中不得非法使用或处分 bpc 或他人的知识产权权利。用户不得将已发表于 bpc 的信息以任何形式发布或授权其它网站（及媒体）使用。<br />\r\n<br />\r\n九、客户服务<br />\r\n<br />\r\nbpc 建立专业的客服团队，并建立完善的客户服务制度，从技术、人员和制度上保障用户提问及投诉渠道的畅通，为用户提供及时的疑难解答与投诉反馈。<br />\r\n<br />\r\n十、协议的变更和终止<br />\r\n<br />\r\n10.1 协议的变更： bpc 有权随时对本协议内容或 bpc 发布的其他服务条款及操作规则的内容进行变更，变更时 bpc 将在 bpc 站内显著位置发布公告，变更自公告发布之时生效，如用户继续使用 bpc 提供的服<br />\r\n<br />\r\n务即视为用户同意该等内容变更，如用户不同意变更后的内容则用户有权注销 bpc 账户、停止使用 bpc 服务。<br />\r\n<br />\r\n10.2 协议的终止<br />\r\n<br />\r\n10.2.1 bpc 有权依据本协议约定注销用户的 bpc 账号，本协议于账号注销之日终止。<br />\r\n<br />\r\n10.2.2 bpc 有权依据本协议约定终止全部 bpc 服务，本协议于 bpc 全部服务终止之日终止。<br />\r\n<br />\r\n10.2.3 本协议终止后，用户无权要求 bpc 继续向其提供任何服务或履行任何其他义务，包括但不限于要求 bpc 为用户保留或向用户披露其原 bpc 账号中的任何信息，向用户或第三方转发任何其未曾阅读或发送过的信息等。<br />\r\n<br />\r\n10.2.4 本协议的终止不影响守约方向违约方追究违约责任。<br />\r\n<br />\r\n十一、隐私权政策<br />\r\n<br />\r\n11.1 适用范围<br />\r\n<br />\r\n11.1.1 在用户注册 bpc 账号或者支付账户时，用户根据 bpc 要求提供的个人注册信息，包括但不限于身份证件信息；<br />\r\n<br />\r\n11.1.2 在用户使用 bpc 服务时或访问 bpc 网页时， bpc 自动接收并记录的用户浏览器上的服务器数值，包括但不限于IP地址等数据及用户要求取用的网页记录；<br />\r\n<br />\r\n11.1.3 bpc 收集到的用户在 bpc 进行交易的有关数据，包括但不限于出价、购买等记录；<br />\r\n<br />\r\n11.1.4 bpc 通过合法途径取得的其他用户个人信息。<br />\r\n<br />\r\n11.2 信息使用<br />\r\n<br />\r\n11.2.1 bpc 不会向任何人出售或出借用户的个人信息，除非事先得到用户的许可。 bpc 也不允许任何第三方以任何手段收集、编辑、出售或者无偿传播用户的个人信息。<br />\r\n<br />\r\n11.3 bpc 对所获得的客户身份资料和交易信息进行保密，不得向任何单位和个人提供客户身份资料和交易信息，法律法规另有规定的除外。<br />\r\n<br />\r\n十二、反洗钱<br />\r\n<br />\r\n12.1 bpc 遵守和执行国际反洗钱法的规定，对用户进行身份识别、客户身份资料和交易记录保存制度，以及大额和可疑交易报告的制度。<br />\r\n<br />\r\n12.2 用户注册、挂失交易密码或者资金密码时，应当提供并上传身份证复印件， bpc 对用户提供的身份证信息进行识别及比对。 bpc 有合理的理由怀疑用户使用虚假身份注册时，有权拒绝注册或者注销已经注册的账户。<br />\r\n<br />\r\n12.3 bpc 参照《金融机构大额交易和可疑交易报告管理办法》的规定，保存大额交易和有洗钱嫌疑的交易记录，在监管机构要求提供大额交易和可疑交易的记录时，向监管机构提供。<br />\r\n<br />\r\n12.4 bpc 对用户身份信息以及大额交易、可疑交易记录进行保存，依法协助、配合司法机关和行政执法机关打击洗钱活动，依照法律法规的规定协助司法机关、海关、税务等部门查询、冻结和扣划客户存款。<br />\r\n<br />\r\n十三、风险提示<br />\r\n<br />\r\n13.1 数字货币交易有极高的风险。<br />\r\n<br />\r\n13.1.1 数字货币市场是全新的、未经确认的，且可能不会增长。目前，数字货币主要由投机者大量使用，零售和商业市场使用相对较少，因此数字货币价格易产生波动，进而对数字货币投资产生不利影响。<br />\r\n<br />\r\n13.1.2 数字货币市场没有涨跌停限制，同时交易是24小时开放的。数字货币由于筹码较少，价格易受庄家控制，有可能出现一天价格涨几倍的情况，同时也可能出现一天内价格跌去一半的情况。<br />\r\n<br />\r\n13.2 参与数字货币交易，用户应当自行控制风险，评估数字货币投资价值和投资风险，承担损失全部投资的经济风险。<br />\r\n<br />\r\n13.3 因国家法律、法规和规范性文件的制定或者修改，导致数字货币的交易被暂停、或者禁止的，由此造成的经济损失全部由用户自行承担。<br />\r\n<br />\r\n十四、违约责任<br />\r\n<br />\r\n14.1 bpc 或用户违反本协议的约定即构成违约，违约方应当向守约方承担违约责任。<br />\r\n<br />\r\n14.2 如因用户提供的信息不真实、不完整或不准确给 bpc 造成损失的， bpc 有权要求用户对 bpc 进行损失的赔偿。<br />\r\n<br />\r\n14.3 如因用户违反法律法规或本协议约定，在 bpc 或利用 bpc 服务从事非法活动的， bpc 有权立即终止继续对其提供 bpc 服务，注销其账号，并要求其赔偿由此给 bpc 造成的损失。<br />\r\n<br />\r\n14.4 如用户以技术手段干扰 bpc 的运行或干扰其他用户对 bpc 使用的， bpc 有权立即注销其 bpc 账号，并有权要求其赔偿由此给 bpc 造成的损失。<br />\r\n<br />\r\n14.5 如用户以虚构事实等方式恶意诋毁 bpc 的声誉， bpc 有权要求用户向 bpc 公开道歉，赔偿其给 bpc 造成的损失，并有权终止对其提供 bpc 服务。<br />\r\n<br />\r\n十五、争议解决<br />\r\n<br />\r\n15.1 用户与 bpc 因本协议的履行发生争议的应通过友好协商解决，协商解决不成的，任一方有权将争议提交北京仲裁委员会依据该会仲裁规则进行仲裁。<br />\r\n<br />\r\n十六、协议的生效和解释<br />\r\n<br />\r\n16.1 本协议于用户点击 bpc 注册页面的同意注册并完成注册程序、获得 bpc 账号和密码时生效，对 bpc 和用户均具有约束力。<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />','wkc_cny','wkc','cny','<p>\r\n\t风险警告：根椐人民银行等有关部委的相关规定，比特币等数字货币系特殊的虚拟商品，作为互联网上的商品买卖行为，普通民众在自担风险的前提下拥有参与的自由。数字货币行业目前存在很多不确定，不可控的风险因素（如预挖、暴涨暴跌、庄家操控、团队解散、技术缺陷等），导致交易具有极高的风险。玩客币(链克)交易网仅为数字货币等虚拟商品的爱好者提供一个自由的网上交换平台，对在玩客币(链克)交易网平台交换的数字货币等虚拟商品的来源、价值，网站运营方不承担任何审查、担保、赔偿的法律责任，如果您不能接受，请不要进行交易！\r\n</p>\r\n<p>\r\n\t<br />\r\n</p>','新认购风险提示不投入超过风险承受能力的资金，不投资不了解的数字资产，不听信任何以玩客币(链克)交易网名义推荐买币投资的宣传，坚决抵制传销、电信诈骗和洗钱套汇等违法行为。','1','','111','111','123456','http://weibo.com/123456','','q123456','qun123456','123456','5a32a68e659cc.jpg','5a32a6924f189.jpg','83839140@qq.com','83839140@qq.com','56f98e6d7245d.jpg','中国银行|动说科技|0000 0000 0000 0000','2','2','2','2','&lt;span&gt;&lt;span&gt;会员您好,务必正确填写好自己的真实姓名和真实身份证号码.&lt;/span&gt;&lt;/span&gt;','&lt;span&gt;会员您好,务必用自己的手机号码进行手机认证,认证以后可以用来接收验证码.&lt;/span&gt;','&lt;span&gt;会员您好,务必正确填写支付宝 &amp;nbsp;真实姓名（与实名认证姓名相同）和支付宝账号,后期提现唯一依据.&lt;/span&gt;','&lt;span&gt;会员您好,&lt;/span&gt;&lt;span&gt;&lt;span&gt;务必正确填写银行卡信息 提现唯一依据.&lt;/span&gt;&lt;span&gt;&lt;/span&gt;&lt;/span&gt;','&lt;span&gt;自己以往操作和登录及登录地点的相关记录.&lt;/span&gt;','&lt;span&gt;会员您好,修改登录密码以后请不要忘记.若不记得旧登录密码,请点击--&lt;/span&gt;&lt;span style=&quot;color:#EE33EE;&quot;&gt;忘记密码&lt;/span&gt;','&lt;span&gt;会员您好,修改交易密码以后请不要忘记.若不记得旧交易密码,请点击--&lt;/span&gt;&lt;span style=&quot;color:#EE33EE;&quot;&gt;忘记密码&lt;/span&gt;','100','50000','100','cny','1','1','10000000','10','&lt;span&gt;&lt;span&gt;你委托买入或者卖出成功交易后的记录.&lt;/span&gt;&lt;/span&gt;','5','24','1','100000','100','100000','100','理财首页','理财记录','理财类型','1','5','3','2','中国人自己的比特币','&lt;span&gt;&lt;span&gt;查看自己推广的好友,请点击&lt;/span&gt;&lt;span style=&quot;color:#EE33EE;&quot;&gt;“+”&lt;/span&gt;&lt;span&gt;,同时正确引导好友实名认证以及买卖,赚取推广收益和交易手续费.&lt;/span&gt;&lt;/span&gt;','系统可靠','银行级用户数据加密、动态身份验证多级风险识别控制，保障交易安全','系统可靠','账户多层加密，分布式服务器离线存储，即时隔离备份数据，确保安全','快捷方便','充值即时、提现迅速，每秒万单的高性能交易引擎，保证一切快捷方便','服务专业','热忱的客服工作人员和24小时的技术团队随时为您的账户安全保驾护航','&lt;p&gt;\r\n\t&lt;a href=&quot;/Article/index/type/aboutus.html&quot; target=&quot;_blank&quot;&gt;/Article/index/type/aboutus.html&lt;/a&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&amp;lt;a href=&quot;&lt;a href=&quot;/Article/index/type/aboutus.html&quot; target=&quot;_blank&quot;&gt;/Article/index/type/aboutus.html&lt;/a&gt;&quot;&amp;gt;关于我们&amp;lt;/a&amp;gt;\r\n&lt;/p&gt;\r\n|&lt;br /&gt;\r\n&amp;lt;a href=&quot;/Article/index/type/aboutus.html&quot;&amp;gt;联系我们&amp;lt;/a&amp;gt;&lt;br /&gt;\r\n|&lt;br /&gt;\r\n&amp;lt;a href=&quot;/Article/index/type/aboutus.html&quot;&amp;gt;资质证明&amp;lt;/a&amp;gt;&lt;br /&gt;\r\n|&lt;br /&gt;\r\n&amp;lt;a href=&quot;/Article/index/type/aboutus.html&quot;&amp;gt;用户协议&amp;lt;/a&amp;gt;&lt;br /&gt;\r\n|&lt;br /&gt;\r\n&amp;lt;a href=&quot;/Article/index/type/aboutus.html&quot;&amp;gt;法律声明&amp;lt;/a&amp;gt;&lt;br /&gt;\r\n&amp;lt;p style=&quot;margin-top: 5px;text-align: center;&quot;&amp;gt;&lt;br /&gt;\r\nCopyright &amp;copy; 2016&lt;br /&